Defendant Charles A Zaja in court with Attorney Vincent J. Bobot.  Pablo Galaviz appeared for the State of Wisconsin.  Case called for sentencing hearing.  State gives sentencing recommendations.  Attorney Bobot makes statements regarding sentencing.  Defendant makes statements.  Court sentences the Defendant to the following:

COUNT #1:  WITHHELD SENTENCE:   

*D/L REVOCATION: 20 months.
*IGNITION INTERLOCK: 20 months.

TERM OF PROBATION:  2 YEARS;

CONDITIONS OF PROBATION:  
*AODA Assessment and follow through with any treatment recommended;
*Absolute Sobriety;  Random U.A.'s ; 
*No Use or Possession of alcohol or illegal drugs 
*DNA sample to be provided if not yet previously done 
*No contact with victim listed in criminal complaint
*Attend Victim Impact Panel on 11/19/14.  Defendant to serve 30 days huber, consecutive, as penalty for failure to attend Victim Impact Panel 

BLOOD DRAW FEE:  $35.00 (to be paid as a condition of probation - to be forward to New Berlin Police Department);

FINE:  $1,330.00 & $250.00 DNA surcharge (to be paid out of cash bail posted ($1,500.00) - remainder to be paid as a condition of probation);

CONDITION TIME:  90 DAYS, Non-working hours with standard release conditions (elder care allowed), commencing 10/29/14 by 8:00 p.m. 

Felony warnings, voting rights and firearms warnings given
